return new Promise(resolve => {
    app.log("IN NAME VALIDATOR")
    let phoneNumber = app.sender
    let msg = app.data.message;
    app.log(msg, "Message")
    if (msg.match(/^[A-Za-z\s]+$/)) {
        let removeUselessWords = function (txt) {
            let uselessWordsArray =
                [
                    'a', 'at', 'be', 'can', 'cant', 'could', 'couldnt',
                    'do', 'does', 'how', 'i', 'in', 'is', 'many', 'much', 'of',
                    'on', 'or', 'should', 'shouldnt', 'so', 'such', 'the',
                    'them', 'they', 'to', 'us', 'we', 'what', 'who', 'why',
                    'with', 'wont', 'would', 'wouldnt', 'you', 'my', 'name', 'is', 'you', 'can', 'call', 'me', 'I', 'am', 'yeah', 'sure'
                ];
            let expStr = uselessWordsArray.join('|');
            return txt.replace(new RegExp('\\b(' + expStr + ')\\b', 'gi'), ' ')
                .replace(/\s{2,}/g, ' ');
        }
        let name = removeUselessWords(msg)
        let userName = name.charAt(0).toUpperCase() + name.substring(1)
        app.dataStore.insert({
            "table": "existing_users",
            "record": {
                "phone_number": phoneNumber,
                "user_name": userName
            }
        })
        app.sendTextMessage(`Hai Bapak/Ibu ${userName}`)
        return resolve()
    } else {
        app.sendTextMessage(app.renderMessage('valid-name', {}, "Please give a valid name"))
        setTimeout(function () {
            // return app.triggerIntent('default', {}, {})
            return app.executeFunction('triggerStart', {}, {})
        }, 2000)
    }
});

